import React from "react";

function Profile (){
    return(
        <div className="Profile">
            <div style={{display:"flex",flexDirection:"column"}}>
                <div  >
                    <img style={{width:"150px",height:"140px",borderRadius:"100%"}} src="https://pbs.twimg.com/media/Ez5yIwsVUAcW-U0.jpg:large" />
                </div>
                <div>
                    <h2>Pawan Kalyan</h2>
                </div>
            </div>
        </div>       
    );
}

export default Profile;
